public class WPPTransportPlanBoard extends FormRun
{
    List                                warningWindowCtrlsDlv;
    List                                warningWindowCtrlsLoad;

    WPPTransportPlanboardForm           formClass;

    // data classes
    WPPTransportPlanboardData_Planned   dataClassPlanned;
    WPPTransportPlanboardData_Dlv       dataClassDlv;
    WPPTransportPlanboardData_Load      dataClassLoad;

    WPPTransportPlanboardSettings       settings;

}

public void close()
{
    super();

    settings = WPPTransportPlanboardSettings::findOrCreate();
    ColumnWidth rowItemWidth = HPBPlanned.parmRowItemWidth();

    if (settings.RowItemWidth != rowItemWidth)
    {
        ttsbegin;
        settings.selectForUpdate(true);
        settings.RowItemWidth = rowItemWidth;
        settings.update();
        ttscommit;
    }
}

public container getPackedImageResource(NoYes                       _isSubRental,
                                        RORAmendmentExchangeType    _exchangeType,
                                        BOBObjectTableRecId         _objectTableRecId,
                                        NoYes                       _isObjectAvailable,
                                        ABC                         _abcValue)
{
    #define.ImgSubRental('dnr_ico3087')
    #define.ImgTechnicalExch('dnr_ico12279')
    #define.ImgCommercialExch('dnr_ico11437')
    #define.ImgObjNotAvailable('Error_16')

    ImageResourceName imgResName;

    switch(_abcValue)
    {
        case ABC::A:
            if (_isSubRental)
            {
                imgResName = #ImgSubRental;
            }
            break;

        case ABC::B:
            if(_exchangeType == RORAmendmentExchangeType::Technical)
            {
                imgResName = #ImgTechnicalExch;
            }
            else if(_exchangeType == RORAmendmentExchangeType::Commercial)
            {
                imgResName = #ImgCommercialExch;
            }
            break;

        case ABC::C:
            if (_objectTableRecId && !_isObjectAvailable)
            {
                imgResName = #ImgObjNotAvailable;
            }
            break;
    }

    return imgResName ? ImageReference::constructForAotResource(imgResName).pack() : conNull();
}

// called from \Classes\WPPTransportPlanboardForm
public WPPTmpTransportPlanboardData getSelectedGridRecord(WPPPlannedDlvLoad _plannedDlvLoad)
{
    WPPTmpTransportPlanboardData tmpTransportPlanboardData;

    switch (_plannedDlvLoad)
    {
        case WPPPlannedDlvLoad::Delivery:
            tmpTransportPlanboardData = TmpTransportPlanboardDataDlv_ds.cursor();
            break;

        case WPPPlannedDlvLoad::Load:
            tmpTransportPlanboardData = TmpTransportPlanboardDataLoad_ds.cursor();
            break;

        default:
            throw error(Error::missingParameter(null));
    }

    return tmpTransportPlanboardData;
}

// called from \Classes\WPPTransportPlanboardForm
public WPPTransportPlanboardSettings getSettings()
