public void init()
{
    dataClassDlv    = new WPPTransportPlanboardData_Dlv();
    dataClassLoad   = new WPPTransportPlanboardData_Load();

    settings = WPPTransportPlanboardSettings::findOrCreate();

    super();

    formClass = new WPPTransportPlanboardForm(element);

    element.initPlanboardPlanned();        
}

private void initPlanboardPlanned()
{
    FromDate.dateValue(DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone()));
    ToDate.dateValue(DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone()) + 1);

    dataClassPlanned = new WPPTransportPlanboardData_Planned();
    dataClassPlanned.parmPlanBoard(HPBPlanned);

    HPBPlanned.parmRowItemWidth(settings.RowItemWidth);
}

