// called from \Classes\WPPTransportPlanboardForm
public void refreshApply(boolean _doPlanned, boolean _doDlv, boolean _doLoad)
{
    #TimeConstants

    settings = WPPTransportPlanboardSettings::findOrCreate();

    if (_doPlanned)
    {
        StartDateTime   startDateTime = DateTimeUtil::newDateTime(FromDate.dateValue(), 0);
        EndDateTime     endDateTime   = DateTimeUtil::newDateTime(ToDate.dateValue(), timeMax());

        if (startDateTime > endDateTime)
        {
            throw Error("@DNR:PBDateRangeError");
        }

        HPBPlanned.parmStartDate(startDateTime);
        HPBPlanned.parmEndDate(endDateTime);

        dataClassPlanned.setPlanningDates(FromDate.dateValue(), ToDate.dateValue());
        dataClassPlanned.run(settings);
        itemCountPlanned.text(strFmt('(%1)', dataClassPlanned.getPlanningEntryCount()));
    }

    if (_doDlv)
    {
        dataClassDlv.run(settings);

        if (settings.DisplayModeDlv == WPPPlanboardDisplayMode::Grid)
        {
            TmpTransportPlanboardDataDlv.linkPhysicalTableInstance(dataClassDlv.getTmpData());
            TmpTransportPlanboardDataDlv_ds.research();
            itemCountDlv.text(strFmt('(%1)', WPPTmpTransportPlanboardData::getNumberOfRecords(TmpTransportPlanboardDataDlv)));
        }
        else
        {
            itemCountDlv.text(strFmt('(%1)', dataClassDlv.getPlanningEntryCount()));
        }
    }

    if (_doLoad)
    {
        dataClassLoad.run(settings);

        if (settings.DisplayModeLoad == WPPPlanboardDisplayMode::Grid)
        {
            TmpTransportPlanboardDataLoad.linkPhysicalTableInstance(dataClassLoad.getTmpData());
            TmpTransportPlanboardDataLoad_ds.research();
            itemCountLoad.text(strFmt('(%1)', WPPTmpTransportPlanboardData::getNumberOfRecords(TmpTransportPlanboardDataLoad)));
        }
        else
        {
            itemCountLoad.text(strFmt('(%1)', dataClassLoad.getPlanningEntryCount()));
        }
    }
}

// called from \Classes\WPPTransportPlanboardForm
public void refreshEntry(WPPPlannedDlvLoad _plannedDlvLoad)
{
    switch (_plannedDlvLoad)
    {
        case WPPPlannedDlvLoad::Planned:
            dataClassPlanned.refreshEntry(true);
            break;

        case WPPPlannedDlvLoad::Delivery:
            dataClassDlv.refreshEntry(true);
            break;

        case WPPPlannedDlvLoad::Load:
            dataClassLoad.refreshEntry(true);
            break;

        default:
            //Do nothing
            break;
    }
}

// called from \Classes\WPPTransportPlanboardForm
public void refreshGrid(WPPPlannedDlvLoad _plannedDlvLoad)
{
    switch (_plannedDlvLoad)
    {
        case WPPPlannedDlvLoad::Delivery:
            element.refreshApply(false, true, false); // refresh delivery tasks
            break;

        case WPPPlannedDlvLoad::Load:
            element.refreshApply(false, false, true); // refresh pick-up tasks
            break;

        default:
            //Do nothing
            break;
    }
}

public void run()
{
    super();

    ttsbegin;
    settings.selectForUpdate(true);
    settings.ToDateDlv  = DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone()) + 7;
    settings.ToDateLoad = DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone()) + 7;
    settings.update();
    ttscommit;

    settings.reread();

    // initial population
    element.refreshApply(true, true, true);
}

public void setWarningIconsDelivery()
{
    #define.imgResBlank(3016)

    container           warnings;
    Counter             cnt;
    FormWindowControl   ctrl;
    ListEnumerator      enumerator;
    ResourceId          imgResId;

    // build list to hold references to window controls (if we haven't already)
    if (!warningWindowCtrlsDlv)
    {
        warningWindowCtrlsDlv = new List(Types::Class);

        //for(cnt = 1; cnt <= warningGroupDlv.controlCount(); cnt ++)
        //{
            //ctrl = warningGroupDlv.controlNum(cnt);
            //warningWindowCtrlsDlv.addEnd(ctrl);
        //}
    }

    // get all warnings that apply to the current record
    warnings = dataClassDlv.getImages(TmpTransportPlanboardDataDlv);

    // enumerate the window controls and set the images
    enumerator = warningWindowCtrlsDlv.getEnumerator();

    for (cnt = 1; enumerator.moveNext(); cnt ++)
    {
        ctrl = enumerator.current();
        imgResId = conPeek(warnings, cnt);
        ctrl.imageResource(imgResId ? imgResId : #imgResBlank);
    }
}

