public void init()
{
    super();

    // Our instance of WPPTransportPlanboardData_Unplanned hasn't been initialized at
    // this point, because its constructor requires a planboard control instance
    // (which isn't ready yet). So in order to establish the link between this
    // data source and the TempDb table, we need to instantiate the temporary table,
    // insert at least one record, and then connect it to the data source here.

    TmpTransportPlanboardDataDlv.linkPhysicalTableInstance(dataClassDlv.getEmptyTmpTable());

    switch (WPPParameters::find().TPBFleetNumber)
    {
        case DNRVisibleFleetNumber::AssetId:
            TmpTransportPlanboardDataDlv_AssetId.visible(true);
            break;

        case DNRVisibleFleetNumber::InventSerialId:
            TmpTransportPlanboardDataDlv_InventSerialId.visible(true);
            break;

        case DNRVisibleFleetNumber::ObjectId:
            TmpTransportPlanboardDataDlv_BOBObjectId.visible(true);
            break;

        case DNRVisibleFleetNumber::FleetNumber:
            TmpTransportPlanboardDataDlv_BOBFleetNumber.visible(true);
            break;

        default:
            // do nothing
            break;
    }
}

